import DefaultLayout from './layouts/DefaultLayout';
import Ulap from './components/Ulap/Ulap';
import Home from './components/Ulap/Home';
import ProductFinder from './components/ProductFinder/ProductFinder';

const routes = [
  {
    path: '/',
    element: DefaultLayout,
    children: [
      {
        path: '/',
        element: Home,
      },
      {
        path: '/product-finder',
        element: ProductFinder,
      },
    ],
  },
];

export default routes;
